#include<iostream> 
#include<vector> 
#include<set> 
using namespace std; 
 
class ProductBundling 
{ 
public: 
  int howManyBundles(vector <string> data) 
  { 
    int i,j,len1,len2; 
     
    set <string> s; 
    string t; 
     
    len1=data.size(); 
    len2=data[0].size(); 
     
    for(i=0;i<len2;i++) 
    { 
      t=""; 
      for(j=0;j<len1;j++) 
      { 
        t+=data[j][i]; 
      } 
      s.insert(t); 
    } 
     
    return s.size(); 
  } 
};

